function InitCanvas(target_query, userData) {
  var on_init = Module.cwrap('on_init', 'undefined', ['int', 'int', 'number']);
  const canvas = document.querySelector(UTF8ToString(target_query));
  let rect = canvas.getBoundingClientRect();
  on_init(rect["right"] - rect["left"], document.documentElement.scrollHeight, userData);

  window.onresize = (event) => {
    var on_resize = Module.cwrap('on_resize', 'undefined', ['int', 'int', 'number']);
    let rect = canvas.getBoundingClientRect();
    on_resize(rect["right"] - rect["left"], document.documentElement.scrollHeight, userData);
  };
}

function InitHomeMenu(userData)
{
  var on_about_clicked = Module.cwrap('on_about_clicked', 'undefined', []);
  var about_button = document.getElementById("mbtn_about");
  if (about_button && on_about_clicked) {
    about_button.onclick = () => {
      on_about_clicked();
    };
  }

  var on_settings_clicked = Module.cwrap('on_settings_clicked', 'undefined', ['number']);
  var settings_button = document.getElementById("mbtn_settings");
  if (settings_button && on_settings_clicked) {
    settings_button.onclick = () => {
      on_settings_clicked(userData);
      
      // var overlay = document.getElementById("deltagrid_root");
      // overlay.style.animation = "transition_right 5s ease-in";
    }
  }
}

function InitSliderCallback(target_id, userData) {
  var oninput = Module.cwrap('on_slider_input', 'undefined', ['float', 'String', 'number']);
  var slider = document.getElementById(UTF8ToString(target_id));
  if (slider && oninput) {
    slider.oninput = () => {
      oninput(slider.value, target_id, userData);
    };
  }
}

function InitCheckBoxChangeCallback(target_id, userData) {
  var onchange = Module.cwrap('on_checkbox_change', 'undefined', ['int', 'String', 'number']);
  var box = document.getElementById(UTF8ToString(target_id));
  if (box && onchange) {
    box.onchange = () => {
      onchange(box.checked, target_id, userData);
    };
  }
  else {
    if (!box) {
      console.error('cant find box');
    }
    else {
      console.error('cant find on change');
    }
  }
}

function SetClickCallback(target_id, userData) {
  var onclick = Module.cwrap('on_click', 'undefined', ['String', 'number']);
  var element = document.getElementById(UTF8ToString(target_id));
  if (element && onclick) {
    element.onclick = (event) => {
      event.preventDefault();
      onclick(target_id, userData);
      return false;
    };
  }
}

function FetchBounds(target_query, userData) {

  var on_bounds = Module.cwrap('on_bounds', 'undefined', ['int', 'int', 'int', 'int', 'number']);
  const elements = document.querySelectorAll(UTF8ToString(target_query));
  elements.forEach((item) => {
    
    let rect = item.getBoundingClientRect();
    if (item.hasAttribute('rim-reverse')) {
      on_bounds(rect["left"] + window.scrollX, rect["bottom"] + window.scrollY, rect["right"] + window.scrollX, rect["top"] + window.scrollY, userData);
  
    }
    else {
      on_bounds(rect["left"] + window.scrollX, rect["top"] + window.scrollY, rect["right"] + window.scrollX, rect["bottom"] + window.scrollY, userData);
    }
  });
}

function SetInnerHtml(targetId, content)
{
  console.log( 'SetInnerHtml', UTF8ToString(targetId), UTF8ToString(content) );

  const target = document.querySelector(UTF8ToString(targetId));
  if (target) {
    target.innerHTML = UTF8ToString(content);
  }
  else {
    console.error( 'SetInnerHtml', UTF8ToString(targetId), UTF8ToString(content) );
  }
}

